import {Outlet} from "react-router-dom";
import {Link as RouterLink} from "react-router-dom";
import {Link} from "@nextui-org/link";

function Layout() {
    return (
        <>
            <header className="w-full flex justify-center items-center gap-5 py-5 bg-[#333] text-white">
                Header
                <ul className="flex gap-2">
                    <Link isBlock showAnchorIcon href="#" color="foreground">
                        Foreground
                    </Link>
                    <RouterLink className="border-white border rounded py-2 px-4" to="/">Home</RouterLink>
                    <RouterLink className="border-white border rounded py-2 px-4" to="/about">About</RouterLink>
                    <RouterLink className="border-white border rounded py-2 px-4" to="/contact">Contact</RouterLink>
                </ul>
            </header>
            <div className="w-full flex justify-center py-5">
                <Outlet/>
            </div>
            <footer className="w-full flex justify-center py-5 bg-[#333] text-white">
                Footer
            </footer>
        </>
    );
}

export default Layout;
